define({"topics" : [{"title":"CEString","shortdesc":"\n                     <p class=\"shortdesc\">CEString is an opaque structure to the public API. The application developer needs to         use the CEM_ APIs to manipulate\n                        it. The structure itself takes care of the variable length         for efficient communication.\n                     </p>\n                  ","href":"cestring.html","attributes": {"data-id":"cestring",},"menu": {"hasChildren":false,},"tocID":"cestring-d66e5188","topics":[]},{"title":"CEAttributes","shortdesc":"\n                     <p class=\"shortdesc\">One or more CEAttributes are passed with certain data types, such as users or         resources. Each CEAttribute takes the\n                        form of a key and a value, both of which are         CEStrings.\n                     </p>\n                  ","href":"ceattributes.html","attributes": {"data-id":"ceattributes",},"menu": {"hasChildren":false,},"tocID":"ceattributes-d66e5199","topics":[]},{"title":"CEResult_t","shortdesc":"\n                     <p class=\"shortdesc\"></p>\n                  ","href":"ceresult_t.html","attributes": {"data-id":"ceresult_t",},"menu": {"hasChildren":false,},"tocID":"ceresult_t-d66e5210","topics":[]},{"title":"CEKeyRoot_t","shortdesc":"\n                     <p class=\"shortdesc\"></p>\n                  ","href":"cekeyroot_t.html","attributes": {"data-id":"cekeyroot_t",},"menu": {"hasChildren":false,},"tocID":"cekeyroot_t-d66e5220","topics":[]},{"title":"CEProtectMode","shortdesc":"\n                     <p class=\"shortdesc\">CEProtectMode is a bitmask for protecting a file or a process. </p>\n                  ","href":"ceprotectmode.html","attributes": {"data-id":"ceprotectmode",},"menu": {"hasChildren":false,},"tocID":"ceprotectmode-d66e5230","topics":[]},{"title":"CEHandle","shortdesc":"\n                     <p class=\"shortdesc\">Handle assigned to various objects for the linking and ID purposes.</p>\n                  ","href":"cehandle.html","attributes": {"data-id":"cehandle",},"menu": {"hasChildren":false,},"tocID":"cehandle-d66e5241","topics":[]},{"title":"Ceint32","shortdesc":"\n                     <p class=\"shortdesc\">Data structure used to represent integers, such as IP addresses, timeout values, or         counts of enti- ties, such as\n                        users or obligations.\n                     </p>\n                  ","href":"ceint32.html","attributes": {"data-id":"ceint32",},"menu": {"hasChildren":false,},"tocID":"ceint32-d66e5252","topics":[]},{"title":"CEBoolean","shortdesc":"\n                     <p class=\"shortdesc\">CEBoolean is a binary value, used for marking either\/or cases, such as whether an         obligation should be imposed in\n                        a given policy evaluation.\n                     </p>\n                  ","href":"ceboolean.html","attributes": {"data-id":"ceboolean",},"menu": {"hasChildren":false,},"tocID":"ceboolean-d66e5263","topics":[]},{"title":"CEAction_t","shortdesc":"\n                     <p class=\"shortdesc\">CE_Actions are a data type that represents any action a user might perform, which         will be checked for policy coverage\n                        through one of the CEEVALUATE calls.\n                     </p>\n                  ","href":"ceaction_t.html","attributes": {"data-id":"ceaction_t",},"menu": {"hasChildren":false,},"tocID":"ceaction_t-d66e5274","topics":[]},{"title":"CEEnforcement_t","shortdesc":"\n                     <p class=\"shortdesc\">CEEnforcements are all possible enforcement decision results that can be returned         from the PDP to the PEP.</p>\n                  ","href":"ceenforcement_t.html","attributes": {"data-id":"ceenforcement_t",},"menu": {"hasChildren":false,},"tocID":"ceenforcement_t-d66e5285","topics":[]},{"title":"CENoiseLevel_t","shortdesc":"\n                     <p class=\"shortdesc\">CENoiseLevel specifies the action level to use for a policy evaluation.</p>\n                  ","href":"cenoiselevel_t.html","attributes": {"data-id":"cenoiselevel_t",},"menu": {"hasChildren":false,},"tocID":"cenoiselevel_t-d66e5297","topics":[]},{"title":"CEPEP_t","shortdesc":"\n                     <p class=\"shortdesc\">CEPEP is a data type that expresses which of the valid types of PEPs is involved in a         given case.</p>\n                  ","href":"cepep_t.html","attributes": {"data-id":"cepep_t",},"menu": {"hasChildren":false,},"tocID":"cepep_t-d66e5308","topics":[]},{"title":"CERequest","shortdesc":"\n                     <p class=\"shortdesc\">CERequest contains all the information for a policyevaluation query that is sent in a         multiquery request to the Policy\n                        Controller. A multi-query request is sent using         CEEVALUATE_CheckResourcesEx().\n                     </p>\n                  ","href":"cerequest.html","attributes": {"data-id":"cerequest",},"menu": {"hasChildren":false,},"tocID":"cerequest-d66e5319","topics":[]}]});